const courtSchema = new mongoose.Schema({
    id: Number,
    amount:Number,
    name: String,
    location: String,
    address: String,
    img1: String,
    img2: String
});

const Court = mongoose.model('court', courtSchema);
// const Detail = mongoose.model("detail", detailSchema);

const bookedcourtsSchema = new mongoose.Schema({
    name: String,
    courts: Array

});

const Booked = mongoose.model('Bookedcourt', bookedcourtsSchema);

