app.post("/book", (req, res)=>{
    console.log("This is the body")
    console.log(req.body);
    const username = req.body.username;
    const courtname = req.body.courtname;
    const time = req.body.time;
    Booked.findOne({name: username}, (err, items)=>{
        if(err)
        {
            console.log("error occured");
        }
        if(items == null)
        {
            
            Booked.insertMany([{name: username, courts:{courtname: courtname, time: time}}], (err, items)=>{
                if(err)
                {
                    console.log("error occured");
                }
                else
                {
                    console.log("These are the items stored")
                    console.log(items);
                    res.send({ok:1});
                }
            });
        }
        else
        {
            Booked.updateOne({name: username}, {$push:{courts:{courtname: courtname, time: time}}}, (err, items)=>{
                console.log("These are the items updated")
                console.log(items);
                if(err)
                {
                    console.log("error occured");
                    console.log(err);
        
                }
                res.send(items);
        
            });

        }
    });
    
});

app.post("/cancel", (req, res)=>{
    console.log(req.body);
    const username = req.body.username;
    const Courtname = req.body.courtname;
    const Bookingtime=req.body.bookingtime;
    Booked.updateOne({name: username}, { $pull:{courts: {courtname: Courtname, time: Bookingtime}}}, (err, items)=>{
        console.log("These are the items updated to cancel")
        console.log(items);
        if(err)
        {
            console.log("error occured");
            console.log(err);

        }
        res.send(items);

    });

});
